import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";

const ViewNotification = () => {
  const [theme, setTheme] = useContext(ThemeContext);
  return (
    <div className="flex flex-col  h-screen p-5">
      <button className="absolute top-0 left-0 m-4 px-4 py-2 bg-blue-500 text-white rounded-lg">
        Create
      </button>
      <button className="absolute top-0 right-0 m-4 px-4 py-2 bg-green-500 text-white rounded-lg">
        Edit
      </button>
      <div className="mt-20">
        <h1 className="text-2xl font-bold text-gray-800">
          A text and view text
        </h1>
        <p className="text-gray-600">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit.
        </p>
      </div>
      <div className="mt-8">
        <h2 className="text-xl font-bold text-gray-800">
          Message with view text
        </h2>
        <p className="text-gray-600">
          Pellentesque habitant morbi tristique senectus et netus et malesuada
          fames ac turpis egestas.
        </p>
      </div>
    </div>
  );
};
export default ViewNotification;
